import './App.css';

function App() {
  return (
    <div>
      <Header />
      <Routes>
        <Route path='/' element={<Signin/>} />
        <Route path='books-list' element={<BooksList/>} />
        <Route path='specific-book' element={<SpecificBook/>} />
        <Route path='purchase' element={<Pur/>} />
      </Routes>
    </div>
  );
}

export default App;
